import React from "react";

function ProductList({product}){
    return(
        <>
            <div className="flex">
                {product.map((prodctItem, productIndex)=>{
                    return(
                        <div style={{width:"50%"}}>
                           <div>
                                <p>{prodctItem.m}</p>
                                <p>{prodctItem.name} | {prodctItem.catogary}</p>
                                <p>{prodctItem.seller}</p>
                                <p>RS-{prodctItem.price} / </p>
                            </div>
                        </div>
                    )
                })}
            </div>
        </>
    )
}
export default ProductList;
